import React, { Component } from 'react';

class TopicPills extends Component {
    state = {  }
    render() { 
        return (
            <div>
                <ul class="nav nav-pills wbdv-topic-pill-list">
                    <li class="nav-item"><a class="nav-link active" href="#">Topic 1</a></li>
                    <li class="nav-item"><a class="nav-link" href="#">Topic 2</a></li>
                    <li class="nav-item"><a class="nav-link" href="#">Topic 3</a></li>
                    <li class="nav-item"><a class="nav-link" href="#">Topic 4</a></li>
                    <li class="nav-item"><a class="nav-link" href="#">+</a></li>
                </ul>
            </div>
          );
    }
}

export default TopicPills;
